function HomePage() {
  return (
    <div style={{heigh}}>
      <div
        style={{
          width: "100%",
          display: "flex",
          justifyContent: "center",
          flexDirection: "column",
          alignItems: "center"
        }}
      >
        <h1 style={{ fontFamily: "fantasy", color: "#4B9BE1" }}>
          lemon3's website
      </h1>
        <h2
          style={{
            marginBottom: "10rem",
            fontFamily: "cursive",
            color: "rgb(243, 103, 123)"
          }}
        >
          click the buttons below
      </h2>
        <button
          style={{
            padding: "1rem",
            fontSize: "2rem",
            background: "blue",
            color: "white",
            fontFamily: 'monospace'
          }}
          onClick={() => alert("Hello there")}
        >
          Welcome
      </button>
        <button
          style={{
            padding: "1rem",
            fontSize: "2rem",
            background: "orange",
            color: "white",
            marginTop: "2rem",
            fontFamily: 'monospace'
          }}
          onClick={() => {
            let name = prompt("What's your name?");
            if (name) {
              alert("Nice to meet you, " + name + "!");
            } else {
              alert("Nice to meet you, stranger");
            }
          }}
        >
          {"What's your name?"}
        </button>
      </div>
    </div>
  );
}

export default HomePage;
